import {
  Menu,
  CalendarDays,
  LayoutList,
  Users,
  Map,
  Bot,
  Settings,
  ArrowRight,
  ArrowLeft,
} from "lucide-react";

import { useState } from "react";

export default function NavBar() {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div className="flex">
    <div className={`duration-300 h-screen bg-black ${isOpen ? "w-[285px]" : "w-[100px]"} transition-width`}>
      <div className="flex justify-center ">
        <div className="flex items-center space-x-3 mx-5 h-20">
          <div className="">
            <div className="flex justify-center rounded-full bg-white h-[40px] w-[40px]">
              <button className="">
                <Menu />
              </button>
            </div>
          </div>

          {isOpen && (
            <div className="text-white  w-[140px] flex flex-col h-[50px] whitespace-nowrap overflow-x-auto">
              <span>Student</span>
              <span>Evan nto</span>
            </div>
          )}
          {!isOpen && (
            <div>
              <button onClick={() => setIsOpen(true)}>
                <ArrowRight color="white" />
              </button>
            </div>
          )}

          {isOpen && (
            <div>
              <button onClick={() => setIsOpen(false)}>
                <ArrowLeft color="white" />
              </button>
            </div>
          )}
        </div>
      </div>
      {isOpen && (
        <div className="px-[35px]"> <div className="bg-white w-full h-0.5 ">
        <text className="text-black">halo</text>
      </div>

          </div>

        )}

      <div className="flex p-[35px]">
        <div className=" w-[200px] h-screen">
        <nav className="h-screen flex w-fit">
          <ul className="space-y-8">
            <div className=" w-[200px]">


            {isOpen && (

                <text className="text-white">Assistant</text>

              )}
            <button className="flex flex-row space-x-5 items-center my-4">
              <li>
                {" "}
                <Bot size="31" color="white" />{" "}
              </li>
              {isOpen && (
                <div className="">
                  <text className="text-white font-medium">Ethan</text>
                </div>
              )}

              </button>

              {isOpen && (
                <div className="bg-white w-full h-0.5">
                <text className="text-black">halo</text>
              </div>
              )}


            </div>


            <div className="space-y-8 ">
              <button className="flex flex-row space-x-5 items-center">
                <li>
                  {" "}
                  <CalendarDays size="30" color="white" />{" "}
                </li>
                {isOpen && (
                  <div className=" ">
                    <text className="text-white font-medium">Calendar</text>
                  </div>
                )}
              </button>
              <button className="flex flex-row space-x-5 items-center">
                <li>
                  {" "}
                  <LayoutList size="30" color="white" />{" "}
                </li>
                {isOpen && (
                  <div className="w-[72px]">
                    <text className="text-white font-medium">To do List</text>
                  </div>
                )}
              </button>
              <button className="flex flex-row space-x-5 items-center">
                <li>
                  {" "}
                  <Users size="30" color="white" />{" "}
                </li>

                {isOpen && (
                  <div className="">
                    <text className="text-white font-medium">Meetings</text>
                  </div>
                )}

              </button>
              <button className="flex flex-row space-x-5 items-center">
                <li>
                  {" "}
                  <Map size="30" color="white" />{" "}
                </li>
                {isOpen && (
                  <div className="">
                    <text className="text-white font-medium">Map</text>
                  </div>
                )}
              </button>
              <button className="flex flex-row space-x-5 items-center">
                <li>
                  {" "}
                  <Settings size="30" color="white" />{" "}
                </li>
                {isOpen && (
                  <div className=" ">
                    <text className="text-white font-medium">Settings</text>
                  </div>
                )}
              </button>
            </div>
          </ul>
        </nav>

        </div>

      </div>
    </div>
    </div>

  );
}
